const ToDoList = (props) =>{

    return (
        <>
        <div style = {{ marginBottom : "20px" }}>

        <li>{props.name}
            <span className="Right" 
                onClick={(props.userClick(props.id))}>X</span>
        
        </li>
        <span>Edit</span> <span>Reply</span>
        </div>
        </>            
    );

};

export default ToDoList;

